const BlogList = ({}) => {
  return (
    <>
      {props.blogs.map((elem) => (
        <div className="blog-preview" key={elem.id}>
          <h2>{elem.title}</h2>
          <p>written by {elem.author}</p>
        </div>
      ))}
    </>
  );
};

export default BlogList;
